export default function Header() {
	return (
	<header className="w-screen inline-flex justify-center">
		<nav className="px-5">
			<a href="/">Home</a>
			<a href="/about">About</a>
		</nav>
		<img  className="mx-8" src="/icons/logo.png" alt="Luna Logo" />
		<nav>
			<a href="/shop">Shop</a>
			<a href="/contact">Contact</a>
		</nav>
	</header>
	);
}
